import * as react from 'react';
import {
  Typography,
  Stack,
  Button,
  Card,
  CardContent,
  CardHeader,
  Divider,
  Box,
  Grid,
} from '@mui/material';

export default function Dashboard(): React.ReactElement {
  return (
    <Box
      sx={{ display: 'flex', direction: 'Column', gap: 2, flex: 1, minHeight: 0, bgcolor: 'white' }}
    >
      <Stack direction="row" alignItems="center" spacing={1}>
        <Typography variant="h6">Overview</Typography>
      </Stack>
    </Box>
  );
}
